import React, { Component } from 'react'
import './sept.css'
import Chat from './Chat'

class ChatMain extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Chat App</h1>
        </header>
        <Chat />
      </div>
    )
  }
}

export default ChatMain
